-- animefigurestore.categories definition

CREATE TABLE `categories` (
                              `category_id` int NOT NULL AUTO_INCREMENT,
                              `category_name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
                              `is_deleted` tinyint(1) DEFAULT '0',
                              `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                              PRIMARY KEY (`category_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- animefigurestore.orders definition

CREATE TABLE `orders` (
                          `order_id` int NOT NULL AUTO_INCREMENT,
                          `user_id` int DEFAULT NULL,
                          `total` decimal(10,0) DEFAULT NULL,
                          `delivery_address` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
                          `payment_option` int DEFAULT NULL COMMENT '0: pay offline, 1: pay online',
                          `payment_status` int DEFAULT NULL COMMENT '0: pending, 1: success, 2: failed',
                          `vnpay_transaction_id` int DEFAULT NULL COMMENT 'vnp_TxnRef: ma giao dich ben vnpay',
                          `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                          PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- animefigurestore.orders_detail definition

CREATE TABLE `orders_detail` (
                                 `order_id` int NOT NULL,
                                 `product_id` int NOT NULL,
                                 `unit_price` decimal(10,0) DEFAULT NULL COMMENT 'gia luc tinh tien',
                                 `amount` int DEFAULT NULL,
                                 `sub_total` int DECIMAL(10,0) DEFAULT NULL COMMENT 'tong gia bill detail',
                                 PRIMARY KEY (`order_id`,`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
ALTER TABLE `animefigurestore`.`orders_detail`
    CHANGE COLUMN `sub_total` `sub_total` DECIMAL(10,0) NULL ;
ALTER TABLE `animefigurestore`.`orders_detail`
    CHANGE COLUMN `unit_price;` `unit_price` DECIMAL(10,0) NULL DEFAULT NULL COMMENT 'gia luc tinh tien' ;


-- animefigurestore.products definition

CREATE TABLE `products` (
                            `product_id` int NOT NULL AUTO_INCREMENT,
                            `product_name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
                            `product_price` decimal(10,0) NOT NULL,
                            `product_images` text COMMENT 'danh sach anh',
                            `product_quantity` int DEFAULT NULL,
                            `product_description` text,
                            `discount` text COMMENT 'gia tri giam gia 50%, 50000',
                            `category_id` int NOT NULL,
                            `is_deleted` tinyint(1) DEFAULT '0',
                            `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                            PRIMARY KEY (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- animefigurestore.roles definition

CREATE TABLE `roles` (
                         `role_id` int NOT NULL AUTO_INCREMENT,
                         `role_name` varchar(50) NOT NULL,
                         `roles_descripion` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
                         `is_deleted` tinyint(1) DEFAULT NULL,
                         `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                         PRIMARY KEY (`role_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- animefigurestore.users definition

CREATE TABLE `users` (
                         `user_id` int NOT NULL AUTO_INCREMENT,
                         `username` varchar(50) NOT NULL,
                         `password` varchar(255) NOT NULL,
                         `fullname` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
                         `address` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
                         `phonenumber` varchar(12) DEFAULT NULL,
                         `email` varchar(255) NOT NULL,
                         `dob` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
                         `avatar` text,
                         `is_deleted` tinyint(1) DEFAULT NULL,
                         `created_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
                         `token` varchar(255) DEFAULT NULL,
                         PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- animefigurestore.users_roles definition

CREATE TABLE `users_roles` (
                               `user_id` int NOT NULL,
                               `role_id` int NOT NULL,
                               PRIMARY KEY (`user_id`,`role_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


ALTER TABLE animefigurestore.users ADD `is_Logged` tinyint(1) DEFAULT NULL;
ALTER TABLE animefigurestore.users ADD `url_image` TEXT DEFAULT NULL;
ALTER TABLE animefigurestore.products ADD `url_image` TEXT DEFAULT NULL;






